import React from 'react';
import { Box, Grommet } from 'grommet';

class AppBar extends React.Component{
    constructor() {

    }

    render(){
        return(<Box
            tag='header'
            direction='row'
            align='center'
            justify='between'
            background='brand'
            pad={{ left: 'medium', right: 'small', vertical: 'small' }}
            elevation='medium'
            style={{ zIndex: '1' }}
        />)
    }
}

export default AppBar
